// src/Home.jsx
import React from 'react';
import './Home.css';
import exampleImage from './images/img.webp';  // Import your image here

function Home() {
  return (
    <div className="home-container">
      <div className="heading-with-image">
        <h1 className="main-heading">LoanChain</h1>
        <img src={exampleImage} alt="LoanChain Logo" className="heading-image" />
      </div>
      {/* <h4 className="sub-heading">Reimagining Loans with NFTs</h4> */}
    </div>
  );
}

export default Home;
